window.bookSummaryJSON = "<p>Baby-making with Kane is right up Jade's alley...until a curse throws a bucket of ice on their fire. Jade and Kane are ready to take the next step in their lives together. But after a routine blessing goes horribly wrong, suddenly any thoughts of starting a family are put on hold when Jade is cursed and their future child threatened. Now the hunt is on to find the one responsible in order to break the curse. But life on Bourbon Street is never that straightforward. There are demons to battle, souls to save, and secrets to be uncovered. And as Jade and her friends get closer to the truth, it's starting to look like someone has made a deal with the devil. </p>"; 
